    activity.result = "faulted";
}

if (checkJobStatusResponse !== "") {
    var deplymStatus = checkJobStatusResponse.deploymentEntity.attributes.status;
    if (deplymStatus === "Deployed") {
        var accessLink = checkJobStatusResponse.accessLink;
        var childJob = checkJobStatusResponse.childJobs[0].id;
        var childJobResource = checkJobStatusResponse.childJobs[0].resource;
	
        workflow.scratchpad.access_link = accessLink;
        workflow.scratchpad.child_job = childJob;
        workflow.scratchpad.child_job_url = childJobResource;
        workflow.scratchpad.deployment_name = checkJobStatusResponse.name;
        workflow.scratchpad.job_status = deplymStatus;
		
		jobDeployed = true;
		
    } else {
        workflow.info("Still looking for CCS Deployed status");
    }
}

if (jobDeployed) {
    activity.result = "success";
} else {
    activity.result = "in_progress";
